import{_ as e}from"./chunks/v5__01.BYtbY4Vm.js";import{_ as t,a,b as l,c as r,d as s,e as o}from"./chunks/v5__quickstart_07.DFnbisE-.js";import{_ as i,c as d,o as n,ab as c}from"./chunks/framework.CUflZczI.js";const V=JSON.parse('{"title":"Короткий посібник з підключення CUAV V5+","description":"","frontmatter":{},"headers":[],"relativePath":"uk/assembly/quick_start_cuav_v5_plus.md","filePath":"uk/assembly/quick_start_cuav_v5_plus.md"}'),p={name:"uk/assembly/quick_start_cuav_v5_plus.md"},h=c('<h1 id="короткии-посібник-з-підключення-cuav-v5" tabindex="-1">Короткий посібник з підключення CUAV V5+ <a class="header-anchor" href="#короткии-посібник-з-підключення-cuav-v5" aria-label="Permalink to &quot;Короткий посібник з підключення CUAV V5+&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">PX4 не виробляє цей (чи будь-який) автопілот. Зверніться до <a href="https://store.cuav.net/" target="_blank" rel="noreferrer">виробника</a> щодо питань технічної підтримки або відповідності вимогам.</p></div><p>Цей короткий посібник показує, як живити польотний контролер <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a> та під&#39;єднати його найважливіші периферійні пристрої.</p><p><img src="'+e+'" alt="V5+ AutoPilot - Hero Image"></p><h2 id="огляд-схеми-підключення" tabindex="-1">Огляд схеми підключення <a class="header-anchor" href="#огляд-схеми-підключення" aria-label="Permalink to &quot;Огляд схеми підключення&quot;">​</a></h2><p>На зображенні нижче показано, як під&#39;єднати найважливіші датчики та периферійні пристрої (за винятком виходів мотора та сервоприводів). Ми розглянемо кожен з них детально в наступних розділах.</p><p><img src="'+t+'" alt="V5+ AutoPilot"></p><table><thead><tr><th style="text-align:left;">Основний інтерфейс</th><th style="text-align:left;">Функція</th></tr></thead><tbody><tr><td style="text-align:left;">Power1</td><td style="text-align:left;">Підключає модуль живлення. Вхід живлення з детекцією <em>аналогової</em> напруги та струму. Не використовуйте Digital PM на цьому роз&#39;ємі!</td></tr><tr><td style="text-align:left;">Power2</td><td style="text-align:left;">Підключає i2c розумну батарею.</td></tr><tr><td style="text-align:left;">TF CARD</td><td style="text-align:left;">Карта SD для зберігання журналів (карта попередньо вставлена на заводі).</td></tr><tr><td style="text-align:left;">M1~M8</td><td style="text-align:left;">ШІМ виходи. Можна використовувати для контролю моторів чи сервоприводів.</td></tr><tr><td style="text-align:left;">A1~A6</td><td style="text-align:left;">ШІМ виходи. Можна використовувати для контролю моторів чи сервоприводів.</td></tr><tr><td style="text-align:left;">DSU7</td><td style="text-align:left;">Використовується для дебагінгу FMU, читання інформації щодо дебагінгу.</td></tr><tr><td style="text-align:left;">І2C1/I2C2</td><td style="text-align:left;">Підключення пристрою I2C, наприклад, зовнішній компас.</td></tr><tr><td style="text-align:left;">CAN1/CAN2</td><td style="text-align:left;">Підключення пристроїв UAVCAN, таких як CAN GPS.</td></tr><tr><td style="text-align:left;">TYPE-C(USB)</td><td style="text-align:left;">Під&#39;єднати до комп&#39;ютера для зв&#39;язку між контролером польоту та комп&#39;ютером, наприклад, як завантаження прошивки.</td></tr><tr><td style="text-align:left;">SBUS OUT</td><td style="text-align:left;">Підключає пристрої SBUS (наприклад, камери з карданним підвісом).</td></tr><tr><td style="text-align:left;">GPS&amp;SAFETY</td><td style="text-align:left;">Приєднайтесь до Neo GPS, який містить GPS, запобіжний вимикач, інтерфейс зумера.</td></tr><tr><td style="text-align:left;">TELEM1/TELEM2</td><td style="text-align:left;">Під&#39;єднатися до системи телеметрії.</td></tr><tr><td style="text-align:left;">DSM/SBUS/RSSI</td><td style="text-align:left;">Включає інтерфейси введення сигналів DSM, SBUS, RSSI, інтерфейс DSM може бути підключений до супутникового приймача DSM, інтерфейс SBUS - до приймача дистанційного керування SBUS, RSSI - для модуля зворотного повернення сили сигналу.</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">Для отримання додаткової інформації про інтерфейс, будь ласка, прочитайте <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">Посібник з V5+</a>.</p></div><p><img src="'+a+'" alt="V5+ AutoPilot"></p><div class="info custom-block"><p class="custom-block-title">Якщо контролер не може бути встановлений у рекомендованому/стандартному положенні (наприклад, через обмеження простору), вам потрібно налаштувати програмне забезпечення автопілота з орієнтацією, яку ви дійсно використали: <a href="./../gps_compass/rtk_gps.html">Орієнтація Польотного Контролера</a>.</p></div><h2 id="gps-компас-запобіжнии-вимикач-led" tabindex="-1">GPS + Компас + Запобіжний вимикач + LED <a class="header-anchor" href="#gps-компас-запобіжнии-вимикач-led" aria-label="Permalink to &quot;GPS + Компас + Запобіжний вимикач + LED&quot;">​</a></h2><p>Рекомендованим модулем GPS є <em>Neo v2 GPS</em>, який містить GPS, компас, запобіжний вимикач, зумер, світлодіодний індикатор статусу.</p><div class="info custom-block"><p class="custom-block-title">Інші модулі GPS можуть не працювати (див. <a href="./../flight_controller/cuav_v5_nano.html#compatibility_gps">цю проблему сумісності</a>)).</p></div><p>Модуль GPS/Компасу слід <a href="./../assembly/mount_gps_compass.html">монтувати на раму</a> якомога далі від інших електронних пристроїв, з маркером напрямку до передньої частини транспортного засобу (стрілка <em>Neo v2 GPS</em> спрямована в тому ж напрямку, що і стрілка управління польотами). Під&#39;єднайтеся до інтерфейсу GPS контролера польоту за допомогою кабелю.</p><p>Якщо ви використовуєте <a href="http://doc.cuav.net/gps/neo-series-gnss/en/neo-v2-pro.html" target="_blank" rel="noreferrer">NEO V2 PRO GNSS (CAN GPS)</a>, будь ласка, використовуйте кабель для підключення до інтерфейсу CAN контролера польоту. :::</p><p><img src="'+l+'" alt="V5+ AutoPilot"></p><h2 id="запобіжнии-вимикач" tabindex="-1">Запобіжний вимикач <a class="header-anchor" href="#запобіжнии-вимикач" aria-label="Permalink to &quot;Запобіжний вимикач&quot;">​</a></h2><p>Спеціальний запобіжний вимикач, який поставляється з V5+, потрібен лише у випадку, якщо ви не використовуєте рекомендований <em>GPS Neo V2</em> (у якому вбудований запобіжний вимикач).</p><p>Якщо ви літаєте без GPS, ви повинні прикріпити вимикач безпосередньо до порту <code>GPS1</code>, щоб мати можливість озброїти рухомий засіб і летіти (якщо ви використовуєте старий GPS з 6 контактами, будь ласка, прочитайте визначення нижнього інтерфейсу для зміни лінії).</p><h2 id="зумер" tabindex="-1">Зумер <a class="header-anchor" href="#зумер" aria-label="Permalink to &quot;Зумер&quot;">​</a></h2><p>Якщо ви не використовуєте рекомендований GPS, зумер може не працювати.</p><h2 id="радіоуправління" tabindex="-1">Радіоуправління <a class="header-anchor" href="#радіоуправління" aria-label="Permalink to &quot;Радіоуправління&quot;">​</a></h2><p>Для того щоб керувати транспортним засобом вручну, потрібна система радіоуправління (RC) (PX4 не потребує системи радіоуправління для автономних режимів польоту). Вам буде потрібно вибрати сумісний передавач/приймач і зв&#39;язати їх таким чином, щоб вони комунікували (ознайомтеся з інструкціями, що додаються до вашого конкретного передавача/приймача).</p><p>На малюнку нижче показано, як ви можете отримати доступ до вашого віддаленого приймача (знайдіть кабель SBUS у комплекті).</p><p><img src="'+r+'" alt="V5+ AutoPilot"></p><h2 id="супутникові-приимачі-spektrum" tabindex="-1">Супутникові приймачі Spektrum <a class="header-anchor" href="#супутникові-приимачі-spektrum" aria-label="Permalink to &quot;Супутникові приймачі Spektrum&quot;">​</a></h2><p>V5+ має присвячений кабель DSM. Якщо використовується супутниковий приймач Spektrum, його слід підключити до інтерфейсу DSM/SBUS/RSSI контролера польоту.</p><h2 id="живлення" tabindex="-1">Живлення <a class="header-anchor" href="#живлення" aria-label="Permalink to &quot;Живлення&quot;">​</a></h2><p>Набір V5+ включає модуль <em>HV_PM</em>, який підтримує LiPo-акумулятори від 2 до 14S. Підключіть 6-контактний роз&#39;єм модуля <em>HW_PM</em> до інтерфейсу живлення керування польотом <code>Power1</code>.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>Наданий модуль живлення не захищений від перегріву. Живлення <strong>повинне</strong> бути вимкнене при підключенні периферійних пристроїв.</p></div><p><img src="'+t+'" alt="V5+ AutoPilot"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Модуль живлення не є джерелом живлення для периферійних пристроїв, підключених до виходів ШІМ. Якщо ви підключаєте сервоприводи / приводи, вам потрібно окремо живити їх за допомогою BEC.</p></div><h2 id="система-телеметріі-опціонально" tabindex="-1">Система телеметрії (Опціонально) <a class="header-anchor" href="#система-телеметріі-опціонально" aria-label="Permalink to &quot;Система телеметрії (Опціонально)&quot;">​</a></h2><p>Система телеметрії дозволяє вам спілкуватися, спостерігати та керувати рухомим засобом у польоті з наземної станції (наприклад, ви можете направляти БПЛА в певне положення або завантажувати нове завдання).</p><p>Канал зв&#39;язку здійснюється через телеметричні радіостанції. Радіостанцію, розташовану на рухомому засобі, слід підключити до порту <code>TELEM1</code> або <code>TELEM2</code> (якщо підключено до цих портів, додаткова конфігурація не потрібна). Інше радіо підключається до вашого комп&#39;ютерного або мобільного пристрою наземної станції (зазвичай за допомогою USB).</p><p><img src="'+s+'" alt="V5+ AutoPilot"></p><p><a id="sd_card"></a></p><h2 id="sd-карта-опціонально" tabindex="-1">SD-карта (Опціонально) <a class="header-anchor" href="#sd-карта-опціонально" aria-label="Permalink to &quot;SD-карта (Опціонально)&quot;">​</a></h2><p><a href="./../getting_started/px4_basic_concepts.html#sd-cards-removable-memory">SD-картку</a> вставляють на заводі (вам нічого не потрібно робити).</p><h2 id="мотори" tabindex="-1">Мотори <a class="header-anchor" href="#мотори" aria-label="Permalink to &quot;Мотори&quot;">​</a></h2><p>Мотори/сервоприводи підключаються до портів MAIN та AUX в порядку, вказаному для вашого рухомого засобу в <a href="./../airframes/airframe_reference.html">Довідці по конструкції літака</a>.</p><p><img src="'+o+'" alt="V5+ AutoPilot"></p><h2 id="схема-розташування-виводів" tabindex="-1">Схема розташування виводів <a class="header-anchor" href="#схема-розташування-виводів" aria-label="Permalink to &quot;Схема розташування виводів&quot;">​</a></h2><p>Завантажте схему розводки <strong>V5+</strong> <a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">звідси</a>.</p><h2 id="додаткова-інформація" tabindex="-1">Додаткова інформація <a class="header-anchor" href="#додаткова-інформація" aria-label="Permalink to &quot;Додаткова інформація&quot;">​</a></h2><ul><li><a href="./../frames_multicopter/dji_f450_cuav_5plus.html">Журнал збірки конструкції повітряного каркасу за допомогою CUAV v5+ на рамі DJI FlameWheel450</a></li><li><a href="http://manual.cuav.net/V5-Plus.pdf" target="_blank" rel="noreferrer">Інструкція з використання CUAV V5+</a> (CUAV)</li><li><a href="http://doc.cuav.net/flight-controller/v5-autopilot/en/v5+.html" target="_blank" rel="noreferrer">Документація CUAV V5+</a> (CUAV)</li><li><a href="https://docs.google.com/spreadsheets/d/1-n0__BYDedQrc_2NHqBenG1DNepAgnHpSGglke-QQwY/edit#gid=912976165" target="_blank" rel="noreferrer">FMUv5 референсна схема розводки</a> (CUAV)</li><li><a href="https://github.com/cuav" target="_blank" rel="noreferrer">CUAV Github</a> (CUAV)</li><li><a href="https://github.com/cuav/hardware/tree/master/V5_Autopilot/V5%2B/V5%2BBASE" target="_blank" rel="noreferrer"> Довідник з конструкції базової плати</a> (CUAV)</li></ul>',47),m=[h];function u(_,f,g,S,b,P){return n(),d("div",null,m)}const A=i(p,[["render",u]]);export{V as __pageData,A as default};
